@bilqisrz Not easy by any means, but there are plenty of strategies. 

For example start smaller or less ambitious so you can accumulate easier wins.

Or work on things where you can't get rejected. I know lots of people who started companies to avoid getting rejected from job interviews.

Every so often I meet someone who's escaped a negative feedback loop in a big way.

@robertjgabriel is one of them. He faced a world of discouragement before being diagnosed w/ dyslexia.

"I was told to drop out of school… my teacher told my parents I wouldn't become anything."

"Put your whole heart into it, love it, invest in it, and care about it. If you do that, things can work out. Even if they don't, you'll grow a lot as a person."

