@RaveeshMotlani @tferriss @davegerhardt @joerogan @guyraz Start small, same as if you were starting a business. Work your way up as you go.

Keep the show fun and easy for you to run. Podcasts fail bc hosts quit early.

Have convos you find interesting with ppl you're comfortable with. Listeners appreciate enthusiasm and good rapport.

@ProductHunt @Abadesi There's also a category of beneficial-but-not-crucial activities that bigger companies have the resources to pursue, but you don't.

You don't have time to do All The Things.

You're gonna write crappy code, ignore metrics, etc. That's not just okay, it's necessary!

