@copyhackers @rdutel @remotiveio 🔥 tip to @aphahn:

"Embed a one-question survey into your thank you pages. Ask this question phrased this exact way: 'What was going on in your life that brought you to do ____ today?'

"Listen to what they say, don't summarize it, and use it on your website and in your emails."

@alexbdebrie @mijustin Not many. Fewer than I should have.

Nowadays I say upfront, "I won't release the episode if it's bad, but no pressure, we can just try again."

Less experienced guests find this relieving. More experienced guests seem apathetic. Everyone appreciates that I care, though.

@mijustin Finding great guests is at least half the battle. Having the kind of convo that fits with the particular guest and allows them to shine is also crucial.

Neither is easy. I'm still trying to figure this stuff out.

And then there's noise. Sometimes ppl are tired, distracted, etc.

